import "./LineData.css";
import "./Lab1EmptyList.css";

function LineData(props) {

return (
    <div className={"all-lines"} onClick={(e) => {clickDivWrapper()}}>
        <ul>
            <li><input type={"checkbox"} className={"checkboxes"}/> <input type={"text"} className={"textboxes"}/>
            </li>
            <li><input type={"checkbox"} className={"checkboxes"}/> <input type={"text"} className={"textboxes"}/>
            </li>
            <li><input type={"checkbox"} className={"checkboxes"}/> <input type={"text"} className={"textboxes"}/>
            </li>
            <li><input type={"checkbox"} className={"checkboxes"}/> <input type={"text"} className={"textboxes"}/>
            </li>
            <li><input type={"checkbox"} className={"checkboxes"}/> <input type={"text"} className={"textboxes"}/>
            </li>
        </ul>
    </div>
)
}

export default LineData;
